品抗皱修活御致臻颜霜。这个家族企业打造了一种全新的美容方式，不仅提供面部护理产品、保湿滋润亦或紧致肌肤的身体护理产品，还有香氛产品。Sisley法国希思黎将专有技能与专业知识体现在每个产品系列之中：卸妆、防晒、护发、抗老、保湿等，以便为客户提供优质的个性化建议。\"},{\"text\":\"Sisley法国希思黎的创始人修伯特与伊莎贝尔·多纳诺的艺术世界对品牌产生了深远影响。他们力图通过自己的作品来传递感情与例外，不趋于主流的美妆趋势，希思黎的彩妆系列产品以品质著称：将希思黎优秀的专业护肤知识运用于彩妆中。请为这些满足所有肌肤与美容需求的高品质产品着迷吧。\"}],\"button\":\"查看更多\"}]','2020-11-06 17:41:45','2020-11-06 17:41:45','2020-07-07 00:00:00','2020-07-31 00:00:00',1,1,1),(3434,300071,'wechat','[{\"tag\":\"swiper\",\"name\":\"轮播\",\"nodes\":[{\"tag\":\"image\",\"src\":{\"pc\":\"https://assets.nightcherry.com//cms/upload/300071/5f3e5720bec88.jpg\",\"h5\":\"https://assetsuat.sisley.com.cn//cms/upload/300071/5f8eafe506d68.jpg\"},\"action\":{\"data\":{\"path\":\"\",\"type\":\"\"},\"type\":\"inner_link\",\"route\":{\"pageKey\":\"product\",\"name\":\"\",\"route\":\"\",\"param\":255}},\"height\":1339},{\"tag\":\"image\",\"src\":{\"pc\":\"https://assets.nightcherry.com//cms/upload/300071/5f3e570f3c37c.jpg\",\"h5\":\"https://assetsuat.sisley.com.cn//cms/upload/300071/5f744d73ac8c1.jpg\"},\"action\":{\"data\":{\"path\":\"/pages/default/landing/landing?code=151\",\"type\":\"\"},\"type\":\"inner_link\",\"route\":{\"pageKey\":\"category\",\"name\":\"活动页面\",\"route\":\"/pages/default/landing/landing\",\"param\":151}},\"height\":237},{\"tag\":\"image\",\"src\":{\"pc\":\"https://assets.nightcherry.com//cms/upload/300071/5f3e572cdd0e9.jpg\",\"h5\":\"https://assetsuat.sisley.com.cn//cms/upload/300071/5fa51a6714f3f.jpg\"},\"action\":{\"data\":{\"path\":\"\",\"type\":\"\"},\"type\":\"inner_link\",\"route\":{\"pageKey\":\"product\",\"name\":\"\",\"route\":\"\",\"param\":374}},\"height\":237}],\"height\":1339,\"columns\":false},{\"tag\":\"blank_space\",\"name\":\"空白组件\",\"height\":30},{\"tag\":\"multi_image_product_high\",\"name\":\"多图（商品）high\",\"nodes\":[{\"tag\":\"image\",\"src\":{\"active\":\"https://assets.nightcherry.com/cms/upload/300071/5f313d28176d6.jpg\",\"hover\":\"https://assets.nightcherry.com/cms/upload/300071/5f313d28176d6.jpg\"},\"action\":{\