79d4a1d515d7ff98ab9fa87d60fc43_154000_01.jpg\",\"name\":\"希思黎致臻夜间修护精华露\",\"desc\":\"卓效抗老化精华\",\"price\":0},{\"product_id\":415,\"sku\":\"106105\",\"src\":\"https://assets.nightcherry.com/upload/img_sort/e119b206f0ac92429da97d57a0187fa7_106105_01.jpg\",\"name\":\"希思黎花香润肤喷雾\",\"desc\":\"清新舒适\",\"price\":0},{\"product_id\":291,\"sku\":\"180800\",\"src\":\"https://assets.nightcherry.com/upload/img_sort/55f35a33b94d0d324ee97cec3f327bae_180800_01.jpg\",\"name\":\"希思黎焕白防护气垫粉底霜SPF30-\",\"desc\":\"\",\"price\":0}],\"columns\":{\"pc\":3,\"h5\":1}},{\"tag\":\"blank_space\",\"name\":\"空白组件\",\"height\":35},{\"tag\":\"icon_title\",\"name\":\"图标标题\",\"title\":\"奢宠予你\"},{\"tag\":\"blank_space\",\"name\":\"空白组件\",\"height\":30},{\"tag\":\"image_on_text_swiper\",\"name\":\"图片上有文字左右滑动\",\"placeholder_pc\":\"https://assets.nightcherry.com//cms/upload/demo/image_on_text_swiper_pc.png\",\"placeholder_h5\":\"https://assets.nightcherry.com//cms/upload/demo/image_on_text_swiper_h5.png\",\"nodes\":[{\"tag\":\"image\",\"src\":\"https://assets.nightcherry.com//cms/upload/300071/5f3e5b87b3018.jpg\",\"action\":{\"data\":{\"path\":\"?code=perfume1plp\",\"type\":\"\"},\"type\":\"inner_link\",\"route\":{\"pageKey\":\"cms\",\"name\":\"\",\"route\":\"\",\"param\":\"perfume1plp\"}},\"on_text\":{\"title\":\"香氛\",\"desc\":\"\"},\"description\":\"法国希思黎香氛代表着充满诗意的嗅觉感受和精致摩登的现代风格。\",\"height\":841},{\"tag\":\"image\",\"src\":\"https://assets.nightcherry.com//cms/upload/300071/5f3e5ac1224a9.png\",\"action\":{\"data\":{\"path\":\"\",\"type\":\"\"},\"type\":\"inner_link\",\"route\":{\"pageKey\":\"product\",\"name\":\"\",\"route\":\"\",\"param\":374}},\"on_text\":{\"title\":\"护发\",\"desc\":\"\"},\"description\":\"法国希思黎睿秀护发系列提供男女皆适用的有效护发产品。\",\"height\":841}],\"columns\":{\"pc\":2,\"h5\":1},\"height\":841},{\"tag\":\"multi_line_text\",\"name\":\"多行文本\",\"title\":\"法国希思黎\",\"sub_title\":\"\",\"lines\":[{\"text\":\"Sisley法国希思黎\\n将植物学专业知识运用于美容产品\"},{\"text\":\"自1976年开始，Sisley法国希思黎以其独特的护肤品致敬植物美容学。\\n不断寻求创新，提取植物精粹，得到强大的活性成分作为配方核心，大受消费者欢迎。如明星单品全能乳液和抗老臻品抗皱修活御致臻颜霜。这个家族企业打造了一种全新的美容方式，不仅提供面部护理产品、保湿滋润亦或紧致肌肤的身体护理产品，还有香氛产品。Sisley法国希思黎将专有技能与专业知识体现在每个产品系列之中：卸妆、防晒、护发、抗老、保湿等，以便为客户提供优质的个性化建议。\"},{\"text\":\"Sisley法国希思黎的创始人修伯特与伊莎贝尔·多纳诺的艺术世界对品牌产生了深远影响。他们力图通过自己的作品来传递感情与例外，不趋于主流的美妆趋势，希思黎的彩妆系列产品以品质著称：将希思黎优秀的专业护肤知识运用于彩妆中。请为这些满足所有肌肤与美容需求的高品质产品着迷吧。\"}],\"button\":\"查看更多\"}]','2020-11-06 17:42:03','2020-11-06 17:42:03',NULL,NULL,0,0,1);

