/*Table structure for table `prod_add_cart_statistics` */

DROP TABLE IF EXISTS `prod_add_cart_statistics`;

CREATE TABLE `prod_add_cart_statistics` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ref_date` date NOT NULL COMMENT '数据采集日期',
  `day_add_times` int(8) NOT NULL COMMENT '每日访问次数',
  `pdtId` varchar(50) NOT NULL COMMENT '产品ID',
  `prodName` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `picUrl` varchar(100) DEFAULT NULL COMMENT '产品图片',
  `series` varchar(50) DEFAULT NULL COMMENT '产品系列',
  `created_at` date DEFAULT NULL COMMENT '创建日期',
  `updated_at` datetime DEFAULT NULL COMMENT '更新日期',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `ref_date` (`ref_date`) USING BTREE,
  KEY `day_add_times` (`day_add_times`) USING BTREE,
  KEY `pdtId` (`pdtId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=840 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品加入购物车次数统计';

