/*Table structure for table `prod_favorite_statistics` */

DROP TABLE IF EXISTS `prod_favorite_statistics`;

CREATE TABLE `prod_favorite_statistics` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ref_date` date NOT NULL COMMENT '统计日期',
  `day_favorite_times` int(8) NOT NULL COMMENT '每日访问次数',
  `pdtId` varchar(50) NOT NULL COMMENT '产品ID',
  `prodName` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `picUrl` varchar(100) DEFAULT NULL COMMENT '产品图片',
  `series` varchar(50) DEFAULT NULL COMMENT '产品系列',
  `created_at` date DEFAULT NULL COMMENT '创建日期',
  `updated_at` datetime(6) DEFAULT NULL COMMENT '更新日期',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `ref_date` (`ref_date`) USING BTREE,
  KEY `day_favorite_times` (`day_favorite_times`) USING BTREE,
  KEY `pdtId` (`pdtId`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品加入商品收藏次数统计';

/*Data for the table `prod_favorite_statistics` */

/*Table structure for table `prod_keywords_statistics` */

DROP TABLE IF EXISTS `prod_keywords_statistics`;

CREATE TABLE `prod_keywords_statistics` (
  `id` int(12) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `keywords` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '被搜索关键词',
  `search_time` int(8) NOT NULL COMMENT '被搜索次数',
  `ref_date` date NOT NULL COMMENT '对应日期',
  `created_at` datetime NOT NULL COMMENT '创建日期',
  `updated_at` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `keywords` (`keywords`) USING BTREE,
  KEY `search_time` (`search_time`) USING BTREE,
  KEY `ref_date` (`ref_date`) USING BTREE
