/*Table structure for table `prod_view_by_cat_statistics` */

DROP TABLE IF EXISTS `prod_view_by_cat_statistics`;

CREATE TABLE `prod_view_by_cat_statistics` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `ref_date` date NOT NULL COMMENT '统计日期',
  `prod_cat_id` varchar(50) NOT NULL COMMENT '类目id',
  `prod_cat_name` varchar(300) DEFAULT NULL COMMENT '类目名称',
  `view_times` int(8) NOT NULL COMMENT '分类被查看次数',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `ref_date` (`ref_date`),
  KEY `cat_id` (`prod_cat_id`),
  KEY `view_times` (`view_times`)
) ENGINE=InnoDB AUTO_INCREMENT=811 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品分类被访问次数统计';

