/*Table structure for table `prod_view_by_type_statistics` */

DROP TABLE IF EXISTS `prod_view_by_type_statistics`;

CREATE TABLE `prod_view_by_type_statistics` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `ref_date` date NOT NULL COMMENT '统计日期',
  `prod_type_code` varchar(50) NOT NULL COMMENT '商品编码',
  `type_view_times` int(8) NOT NULL COMMENT '分类被查看次数',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `updated_at` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品分类被访问次数统计';

/*Data for the table `prod_view_by_type_statistics` */

/*Table structure for table `prod_view_statistics` */

DROP TABLE IF EXISTS `prod_view_statistics`;

CREATE TABLE `prod_view_statistics` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ref_date` date NOT NULL COMMENT '统计日期',
  `day_view_times` int(8) NOT NULL COMMENT '每日访问次数',
  `pdtId` varchar(50) NOT NULL COMMENT '产品ID',
  `prodName` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `picUrl` varchar(100) DEFAULT NULL COMMENT '产品图片',
  `series` varchar(50) DEFAULT NULL COMMENT '产品系列',
  `created_at` date DEFAULT NULL COMMENT '创建日期',
  `updated_at` datetime(6) DEFAULT NULL COMMENT '更新日期',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `pdtId` (`pdtId`) USING BTREE,
  KEY `ref_date` (`ref_date`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1634 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='商品被访问次数统计';

