/*Table structure for table `wx_small_user_portrait_monthly` */

DROP TABLE IF EXISTS `wx_small_user_portrait_monthly`;

CREATE TABLE `wx_small_user_portrait_monthly` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ref_date_start` date DEFAULT NULL COMMENT '开始日期',
  `ref_date_end` date DEFAULT NULL COMMENT '结束日期',
  `v_province` text COLLATE utf8mb4_unicode_ci COMMENT '用户省份信息',
  `user_type` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户类型',
  `v_city` text COLLATE utf8mb4_unicode_ci COMMENT '用户所在城市',
  `v_genders` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户性别',
  `v_devices` text COLLATE utf8mb4_unicode_ci COMMENT '用户设备',
  `v_ages` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户年龄',
  `v_platforms` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户平台',
  `v_index` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户索引',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=239 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='用户特性信息按月';

