/*Table structure for table `wx_small_visit_trend_monthly` */

DROP TABLE IF EXISTS `wx_small_visit_trend_monthly`;

CREATE TABLE `wx_small_visit_trend_monthly` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ref_date` date DEFAULT NULL COMMENT '统计日期',
  `session_cnt` int(11) DEFAULT NULL COMMENT '打开次数',
  `visit_pv` int(11) DEFAULT NULL COMMENT '访问次数',
  `visit_uv` int(11) DEFAULT NULL COMMENT '访问人数',
  `visit_uv_new` int(11) DEFAULT NULL COMMENT '新用户数',
  `stay_time_uv` float(8,0) DEFAULT NULL COMMENT '人均停留时间',
  `stay_time_session` float(8,0) DEFAULT NULL COMMENT '次均停留时间',
  `visit_depth` float(8,0) DEFAULT NULL COMMENT '访问深度',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `begin_date` date DEFAULT NULL COMMENT '开始时间',
  `end_date` date DEFAULT NULL COMMENT '结束时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='访客留存趋势按月';

/*Data for the table `wx_small_visit_trend_monthly` */

/*Table structure for table `wx_small_visit_trend_weekly` */

DROP TABLE IF EXISTS `wx_small_visit_trend_weekly`;

CREATE TABLE `wx_small_visit_trend_weekly` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `ref_date_start` date DEFAULT NULL COMMENT '统计开始日期',
  `ref_date_end` date DEFAULT NULL COMMENT '统计结束日期',
  `session_cnt` int(11) DEFAULT NULL COMMENT '打开次数',
  `visit_pv` int(11) DEFAULT NULL COMMENT '访问次数',
  `visit_uv` int(11) DEFAULT NULL COMMENT '访问人数',
  `visit_uv_new` int(11) DEFAULT NULL COMMENT '新用户数',
  `stay_time_uv` float(8,2) DEFAULT NULL COMMENT '人均停留时长',
  `stay_time_session` float(8,2) DEFAULT NULL COMMENT '次均停留时长',
  `visit_depth` float(8,2) DEFAULT NULL COMMENT '平均访问深度',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `ref_date` date DEFAULT NULL COMMENT '统计日期',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='用户访问趋势按周';

